import React, { useState, useEffect } from "react";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import AutorenewOutlinedIcon from "@mui/icons-material/AutorenewOutlined";
import TablePagination from '@mui/material/TablePagination';

interface RowData {
  id: number;
  channel: string;
  userEmail: string;
}

interface PaginatedTableProps {
  data: RowData[];
  loading: boolean;
  error: string | null;
  fetchData: (page: number, pageSize: number) => Promise<RowData[]>; // Update the return type
}

const Logs = () => {
  const [data, setData] = useState<RowData[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const fetchData = async (page: number, pageSize: number): Promise<RowData[]> => {
    setLoading(true);
    try {
      const response = await fetch(`/api/messages/by-notification?notificationId=1&page=${page}&pageSize=${pageSize}`);
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const responseData = await response.json();
      setError(null);
      return responseData;
    } catch (error) {
      setError("Error fetching data");
      return [];
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData(1, 10).then((fetchedData) => setData(fetchedData));
  }, []);

  return (
    <div className='logs'>
      <div className="logsContainer">
        <PaginatedTable
          data={data}
          loading={loading}
          error={error}
          fetchData={fetchData}
        />
      </div>
    </div>
  );
}

export default Logs;
